1073.source:
function ensureMorphs() {
    this.removeAllMorphs();
    if (this.submorphs.length === 0) {
        for (var i = 0; i < 10; i++) {
            var m = lively.morphic.Morph.makeRectangle(i * 15, i * 15, 30, 30);
            m.setOpacity(0.5);
            this.addDraggingBehavior(m);
            this.addMorph(m);
        }
    }
    var cpy = this.get("sizeSlider").copy();
    this.get("sizeSlider").remove();
    cpy.setName("sizeSlider");
    this.owner.addMorph(cpy);

    this.submorphs[0].setPosition(pt(0, 0));
}

1076.source:
function moveAlongLine(pos, out, dist, morph) {
    var newPt = pos.lineTo(out).sample(dist)[1];
    morph.setPosition(newPt);
    return newPt;
}

1079.source:
function addDraggingBehavior(m) {
    m.disableGrabbing();
    m.enableDragging();
    m.addScript(function onDrag(evt) {
        this.setPosition(this.owner.localize(evt.getPosition()));
    });
}

1082.source:
function addConstraints() {
    var deltablue = new DBPlanner(), cassowary = new ClSimplexSolver(), sizeSlider = this.get("sizeSlider");
    this.submorphs.each(function(ea, idx) {
        bbb.always({
            solver: cassowary,
            ctx: {
                cassowary: cassowary,
                ea: ea,
                pt: pt,
                sizeSlider: sizeSlider,
                idx: idx,
                deltablue: deltablue,
                _$_self: this.doitContext || this
            }
        }, function() {
            return ea.getExtent().equals(pt(sizeSlider.value * 20, sizeSlider.value * 20));;
        });
        if (idx === 0) return;
        var other = this.submorphs[idx - 1], that = this;
        bbb.always({
            solver: deltablue,
            methods: function() {
                ea.getPosition().formula([ other.getPosition() ], function(pos, out) {
                    return that.moveAlongLine(pos, out, sizeSlider.value * 30, ea);
                });
                other.getPosition().formula([ ea.getPosition() ], function(pos, out) {
                    return that.moveAlongLine(pos, out, sizeSlider.value * 30, other);
                });
            },
            ctx: {
                cassowary: cassowary,
                ea: ea,
                pt: pt,
                sizeSlider: sizeSlider,
                idx: idx,
                deltablue: deltablue,
                other: other,
                that: that,
                _$_self: this.doitContext || this
            }
        }, function() {
            return ea.getPosition().dist(other.getPosition()) < sizeSlider.value * 30;;
        });
    }.bind(this));
}

1086.source:
function addConstraints() {
    var deltablue = new DBPlanner(),
        cassowary = new ClSimplexSolver(),
        sizeSlider = this.get("sizeSlider");

    this.submorphs.each(function (ea, idx) {
        always: {
            solver: cassowary;
            ea.getExtent().equals(pt(
                sizeSlider.value * 20,
                sizeSlider.value * 20
            ));
        }

        if (idx === 0) return;
        var other = this.submorphs[idx - 1],
            that = this;

        always: {
            solver: deltablue;
            methods: (function () {
                ea.getPosition().formula([other.getPosition()], function (pos, out) {
                    return that.moveAlongLine(pos, out, sizeSlider.value * 30, ea);
                });
                other.getPosition().formula([ea.getPosition()], function (pos, out) {
                    return that.moveAlongLine(pos, out, sizeSlider.value * 30, other);
                });
            });
            ea.getPosition().dist(other.getPosition()) < sizeSlider.value * 30;
        }
    }.bind(this));
}

